import React from 'react'
import { Container} from "../components/Styles/Container/Container.style";
import {Header, MainHeader} from "../components/Styles/Header/Header.style";

const Home = () => {
    return (
        <Container>
            <Header>
                <MainHeader>
                    <h1> home!!!!!</h1>
                </MainHeader>
            </Header>
        </Container>

    )
}
export default Home
